r\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_damp_87\u003cbr\u003etype: usage\u003c/p\u003e", "x": 349.3493230928433, "y": 13.8586303047721}, {"color": "#377eb8", "id": "1970-2015_damp_319", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet er slik oppvarming som kan vaere aktuelt i Norge. Den\u003cbr\u003eindustrielle bruk av jordvarmen ble innledet i 1840 da man begynte \u00e5\u003cbr\u003eutvinne borsyre fra\u003cb\u003e dam\u003c/b\u003ep som ble tatt opp fra borehull i\u003cbr\u003eLardarello i Italia. Det var ogs\u00e5 her man begynte \u00e5 lage el-kraft fra\u003cbr\u003edampen i 1904\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_damp_319\u003cbr\u003etype: usage\u003c/p\u003e", "x": 0.5482646226230433, "y": -71.29475899133482}, {"color": "#377eb8", "id": "1970-2015_damp_286", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI den naermeste tiden etter en slik underjordisk eksplosjon,\u003cbr\u003evil fjellet rett over eksplosjonsstedet kollapse og danne en\u003cbr\u003e\u00abnedfalls\u00f8yle\u00bb hvor stein og fjellblokker faller ned p\u00e5 den st\u00f8rknede\u003cbr\u003emassen i eksplosjonshullet som derved ikke lenger er hermetisk lukket.\u003cbr\u003eRadioaktive gasser og\u003cb\u003e dam\u003c/b\u003ep vil da lett spre seg oppover i denne\u003cbr\u003evertikale og langstrakte steinmassen\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_damp_286\u003cbr\u003etype: usage\u003c/p\u003e", "x": 359.7462699380985, "y": -113.65833014125894}, {"color": "#ff7f00", "id": "1929-1965_damp_102", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOm en stund igjen h\u00f8rte hun klamp nede paa veien som av\u003cbr\u003ehestedrifter: pilegrimmerne, som vendte hjem fra \u003cb\u003edampen\u003c/b\u003e og\u003cbr\u003ebryggen ! . . .\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_damp_102\u003cbr\u003etype: usage\u003c/p\u003e", "x": -505.6823511090928, "y": -252.95804820611602}, {"color": "#ff7f00", "id": "1929-1965_damp_161", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOg han kjende sakte karane, \u2014 dei hadde jamt i det siste borda\u003cbr\u003e\u003cb\u003edampen\u003c/b\u003e med laksekassone sine. \u2014 Ja hadde der no vore bryggje\u003cbr\u003euppmed land her, so vilde de ha sloppe \u00e5 fylgja med til Reppen, let\u003cbr\u003ehan \u2014 d\u00e5 dampen for framum Totlandsgrenda.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_damp_161\u003cbr\u003etype: usage\u003c/p\u003e", "x": -750.0, "y": -13.453830919929466}, {"color": "#4daf4a", "id": "1929-1965_damp_306", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet stod nu vesentlig bare igjen \u00e5 gj\u00f8re maskinen klar og f\u00e5\u003cbr\u003e\u003cb\u003edampen\u003c/b\u003e op; dette arbeide gikk vi igang med allerede den 18.\u003cbr\u003emai.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_damp_306\u003cbr\u003etype: usage\u003c/p\u003e", "x": -24.488676216282006, "y": 612.1925646095216}, {"color": "#4daf4a", "id": "1929-1965_damp_442", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ePlan hadde bare \u00e5 arbeide og ta i na, og det gjorde han som en\u003cbr\u003ekar. Hammer og slegge gikk i neven som med \u003cb\u003edamp\u003c/b\u003e. I visse mater\u003cbr\u003evar han ogs\u00e5 blitt noks\u00e5 trygg, for passet madam Holman s\u00e5 stritt p\u00e5\u003cbr\u003eham, s\u00e5 var dette ogs\u00e5 en sikkerhet mot at Silla tullet seg bort med\u003cbr\u003eandre.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_damp_442\u003cbr\u003etype: usage\u003c/p\u003e", "x": -194.0529357320144, "y": 447.76778903481386}, {"color": "#f781bf", "id": "1929-1965_damp_16", "label": "3", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVar det tenkelig ar hans medreisende kunde f\u00f8lge med i de\u003cbr\u003erussiske bemerkninger som blev vekslet mellem ham og hans kone? Men\u003cbr\u003ejeg beroliget ham med at jeg bare kunde noen f\u00e5 gloser, det endte i\u003cbr\u003esp\u00f8k. Trotsky fortalte ved frokosten om sin reise ved juletid for tyve\u003cbr\u003e\u00e5r tilbake ombord i en italiensk \u003cb\u003edamper\u003c/b\u003e pa vei fra Spania til\u003cbr\u003eDe Forente Stater.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_damp_16\u003cbr\u003etype: usage\u003c/p\u003e", "x": -540.942559143988, "y": 288.77402849446827}, {"color": "#f781bf", "id": "1970-2015_damp_45", "label": "3", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEt lite jorde vest for grensen mot Lille Oust. Ovre og nedre\u003cbr\u003eMellemengene. Ostbya. Jordet vest for grensen mot Lille Oust. Veien\u003cbr\u003efra \u003cb\u003edamp\u003c/b\u003e skip sb ryggen og Bjbrnenga deler jordet.\u003cbr\u003eRingerikshaugene.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_damp_45\u003cbr\u003etype: usage\u003c/p\u003e", "x": -180.01482976828763, "y": 298.4555339012734}]);
